function Home(){
    return(
        <div class="home">
            <div class="home-info">
                <h1>Reach out to me!</h1>
                <p>I am available on almost every social media platform.
                    You want to discuss a project or just want to say hi? My Inbox is always open for you.
                </p>
            </div>
            <div class="home-img">
                <img class=""src='https://res.cloudinary.com/dvra8rj4n/image/upload/v1705159558/NITSX/s8e6cjvpjyvgocbtbjpt.svg'></img>
            </div>
        </div>
    )
}
export default Home;
